class TaskC {
public:
	void solve(std::istream& in, std::ostream& out) {
		int n, m;
		in >> n >> m;
		auto a = make_vector<int> (n, m, 0);
		for (int i: range(n)) {
			for (int j: range(m)) {
				in >> a[i][j];
			}
		}

		DSU dsu(n * m);
		vector<pair<int, int>> edges;
		edges.reserve(2 * (n * m));

		for (int i: range(n)) {
			vector<int> v(m);
			for (int j: range(m)) {
				v[j] = j;
			}
			sort(v, [&](int x, int y) {
				return a[i][x] < a[i][y];
			});
			for (int j: range(m - 1)) {
				if (a[i][v[j]] == a[i][v[j + 1]]) {
					dsu.unite(i * m + v[j], i * m + v[j + 1]);
				}
				else if (a[i][v[j]] > a[i][v[j + 1]]) {
					edges.emplace_back(i * m + v[j], i * m + v[j + 1]);
				} else {
					edges.emplace_back(i * m + v[j + 1], i * m + v[j]);
				}
			}
		}
		for (int j: range(m)) {
			vector<int> v(n);
			for (int i: range(n)) {
				v[i] = i;
			}
			sort(v, [&](int x, int y) {
				return a[x][j] < a[y][j];
			});
			for (int i: range(n - 1)) {
				if (a[v[i]][j] == a[v[i + 1]][j]) {
					dsu.unite(v[i] * m + j, v[i + 1] * m + j);
				}
				else if (a[v[i]][j] > a[v[i + 1]][j]) {
					edges.emplace_back(v[i] * m + j, v[i + 1] * m + j);
				} else {
					edges.emplace_back(v[i + 1] * m + j, v[i] * m + j);
				}
			}
		}
		vector<int> values(n * m);
		vector<vector<int>> g(n * m);
		for (auto p: edges) {
			g[dsu.getSet(p.first)].push_back(dsu.getSet(p.second));
		}

		vector<int> t(n * m);
		for (int i: range(n * m)) {
			t[i] = i;
		}
		sort(t, [&](int x, int y) {
			return a[x / m][x % m] < a[y / m][y % m];
		});

		for (int i: t) {
			if (dsu.getSet(i) != i) {
				continue;
			}
			int res = 0;
			for(int to: g[i]) {
				res = max(res, values[to]);
			}
			values[i] = res + 1;
		}

		for (int i: range(n)) {
			for (int j: range(m)) {
				out << values[dsu.getSet(i * m + j)] << ' ';
			}
			out << "\n";
		}
	}
};


